import React from "react";
import axios from "axios";
import { useEffect, useState } from "react";
const Member = () => {
  const [member, setMember] = useState([]);

  const [id, setId] = useState("");
  const accessToken = localStorage.getItem("access_token")
  //id get
  axios
    .get("https://codeagain.kro.kr/api/study", {

      headers: {
        "X-AUTH-TOKEN": accessToken,
      },
    })
    .then(function (response) {
      // 성공 핸들링

      setId(response.data.data.id);
    });

  useEffect(() => {
    axios
      .get("https://codeagain.kro.kr/api/study/members/" + id, {
        headers: {
          "X-AUTH-TOKEN": accessToken,
        },
      })
      .then(function (response) {
        console.log("MEMBER LIST SETTING COMPLETE");
        setMember(response.data.data);
      });
  }, [id,accessToken]);
  return (
    <div id="memberList">
      {member.map((member) => {
        return (
          <div
            id="member"
            key={member.id} /*onClick={()=> viewNote(reviewList.id)}*/
          >
            <img src="../../img/profile.png" className="profile" width="85px" alt = "profile"/>
            <p className="name">{member.name}</p>
          </div>
        );
      })}
    </div>
  );
};

export default Member;
